import Carousel from '../components/Carousel';

const SkinCarousel = () => {
    const settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 2
      };

    return (
        <section className="skin-carousel">
            <Carousel settings={settings}/>
        </section>
    )
}

export default SkinCarousel;
